description:
Big Shiny Tunes is a series of rock albums featuring Various Artists compiled and released by the Canadian television station MuchMusic, beginning in 1996. It has been cited as the best-selling album series in Canadian history, with 5 million albums sold in ten years.

The Big Shiny Tunes albums are each thought to be composed of a combination of rock songs that are major hits by well-known artists, less successful songs by well-known artists and songs by more obscure artists, released in the same year as the albums&amp;#039; publication. There are a combination of Canadian, British and American performers. One common feature among the selected artists is that they are attached to Universal Music, Warner Bros., EMI Music Canada, and/or MuchMusic, who come together to produce Big Shiny Tunes albums.

Part of the appeal of the series is that those who do not usually buy albums will find Big Shiny Tunes provides several well-known songs, as opposed to a CD by a single artist whose work is mostly unheard and may not be as likable. The music is aimed at teenagers and young adults.

In addition to the ordinary albums in the series, MuchMusic also released albums such as Big Shiny 80&amp;#039;s (2005) that included classics like Billy Idol&amp;#039;s &quot;White Wedding.&quot; There have also been two volumes of Big Shiny 90&amp;#039;s released.

